    print("=== LOOKING FOR SOURCE FILE REFS ===")
    for i, line in enumerate(lines):
        if 'multi-session-file' in line:
            print(f"Line {i}: {line.strip()}")

    print("=== SESSION NAVIGATION ===")
    in_nav = False
    for i, line in enumerate(lines):
        if 'session-nav' in line:
            in_nav = True
            print(f"Navigation section starting at line {i}")
